import React from 'react';
import { ModalMain ,ModalFrame } from '../StyleComponents/ModalStyle';

function Modal({ isOpen, setisOpen}) {

    if (!isOpen) {
        return null;
    }

    const handleClose = () => {
        setisOpen(false);
    }

    return (
        <ModalMain>
            <ModalFrame onClick={handleClose}></ModalFrame>
            <h1>안녕하세요</h1>
        </ModalMain>
    );
}

export default Modal;
